import React from 'react';
import {DeleteBook, EditBook } from '../../actions/index';
const DataRowItem=({book,onEditClick,onDeleteClick,props})=>{  
    console.log("DataRowItem Component ",book,onEditClick,onDeleteClick)
    const value=book.id;
    return (                            
            <tr key={book.id}>
                {/* <td>{this.props.books.length}</td> */}
                <td>{book.booktitle}</td>
                <td>{book.cover}</td>
                <td>{book.author}</td>
                <td>{book.publisher}</td>       
                <td>  <button value={value} onClick={() => props.onEditClick(value)}>Edit</button><button  value={value} onClick={(e) =>onDeleteClick} className="btn btn-danger">Delete</button></td>
            </tr>
        
        
    )
}

export default DataRowItem;
